import { createMuiTheme } from '@material-ui/core/styles';


const theme = createMuiTheme({
  palette: {
    primary: {
      main: '#ffe521',
      secondary: '#000000',
    },
    secondary: {
      main: '#000',
    },
    text: {
      primary: '#000000',
      secondary: '#ffffff',
    },
    background: {
      default: '#f7f7f7',
    },
  },
  typography: {
    htmlFontSize: 16,
    color: '#ffffff',
    fontFamily: "'Open Sans', sans-serif",
    fontWeight: 100,
    fontSize: 16,
    lineHeight: '145%',
    body1: {
      fontFamily: "'Open Sans', sans-serif",
      fontWeight: 100,
    },
    headline: {
      fontFamily: "'Open Sans', sans-serif",
      textTransform: 'uppercase',
      fontWeight: 100,
      color: '#999',
    },
  },
});


export default theme;
